              <h1 className='s3_h1'>HELLO</h1>
              <h3>Welcome to Liberty!</h3>
              <p>
                A Defi stablecoin ecosystem dedicated to safeguarding the
                liberty of our community <br /> and society.
              </p>
              <div className="header__button">
                <a href="" className="btn btn-outline">
                  CONECT WALLET
